// src/App.js
import React from 'react';
import Header from './Header';
import PersonalInfo from './PersonalInfo';
import Projects from './Projects';
import Courses from './Courses';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1 className="Name">Your Name</h1>
      <h2 className="Subtitle">Aspiring Software Engineer</h2>
      <p className="Intro">Hello! I am Your Name, an aspiring software engineer with a passion for coding, problem-solving, and technology. I am always eager to learn new things and take on new challenges. My goal is to become a skilled software engineer and contribute to the tech community.</p>
      <div className="Links">
        <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer">GitHub</a>
        <a href="https://www.linkedin.com/in/yourusername/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
        <a href="https://twitter.com/yourusername" target="_blank" rel="noopener noreferrer">Twitter</a>
      </div>
      {/* <Header />
      <PersonalInfo />
      <Projects />
      <Courses /> */}
    </div>
  );
}

export default App;
